import React from 'react';
import '../css'

import { Top } from './Top';
import { Navigation } from './Navigation';
import { Links } from './Links';

export class Header extends React.Component {
	render() {
		return (
			<div className="footer-contents">
				<div>{/* <Top /> */}</div>

				<div>{/* <Navigation /> */}</div>

				<div className="link-content">
					<Links />
				</div>
			</div>
		);
	}
}
